import styles from './ElevatorPitch.module.css';

export default function ElevatorPitch() {
    return (
        <section className={styles.ElevatorPitch}>
            <p>Need someone who can help your users make the most of your tech product? I'm pretty good at that.</p>
            <ul>
                <li>Technical support? Sure!</li> 
                <li>Technical writing? Yup.</li>
                <li>Content &amp; product strategy? Those too.</li> 
                <li>And, I'm not a bad programmer either.</li>
            </ul>
            <p>I'm user focused, but data driven. I work well in cross-functional teams. </p>
            <p>I'm ideally placed to support users and speak truth to product.</p>
        </section>
    )
}
